import React from "react";
function MbtiPicture() {
    //mbti 에 맞게 if 또는 case 해서
    let mbti ="img/bg5.jpg"
return(
    <div>
        <img
        className="mbtipicture"
        //alt="bg5"
        src={mbti}
        />
        
        <div className="updown"></div>
    </div>
)
}
export default MbtiPicture;
